import Link from "next/link";

export default async function Detalhe() {
  await new Promise((resolve) => {
    setTimeout(resolve, 500);
  });

  return (
    <>
      {process.env.customKey} Hello Word
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
      </ul>
    </>
  );
}
